import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';

function Manage() {
  const [trips, setTrips] = useState([]);
  const [showEditModal, setShowEditModal] = useState(false);
  const [selectedTrip, setSelectedTrip] = useState({});
  const { id } = useParams();
  const url = 'http://localhost:8080/trip/getAll';

  useEffect(() => {
    axios
      .get(url)
      .then((response) => {
        setTrips(response.data);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, [url]);

  const handleDelete = async (id) => {
    try {
      console.log(
        await axios.delete(`http://localhost:8080/trip/deleteTrip/${id}`)
      );
      setTrips((prevTrips) => prevTrips.filter((trip) => trip.id !== id));
    } catch (error) {
      console.error('Error deleting Trip:', error);
    }
  };

  const handleEdit = (trip) => {
    setSelectedTrip(trip);
    setShowEditModal(true);
  };

  const handleEditModalClose = () => {
    setShowEditModal(false);
    setSelectedTrip({});
  };

  return (
    <div className="container mx-auto mt-8">
      <h2 className="text-3xl font-bold mb-4">Manage Trips</h2>

      <table className="min-w-full bg-blue-100 shadow-md rounded my-6">
        <thead>
          <tr>
           <th className="border-b-2 px-4 py-2">Id</th>
            <th className="border-b-2 px-4 py-2">Destination</th>
            <th className="border-b-2 px-4 py-2">Check-In Date</th>
            <th className="border-b-2 px-4 py-2">Check-Out Date</th>
            <th className="border-b-2 px-4 py-2">People Count</th>
            <th className="border-b-2 px-4 py-2">First Name</th>
            <th className="border-b-2 px-4 py-2">Last Name</th>
            <th className="border-b-2 px-4 py-2">Phone Number</th>
            <th className="border-b-2 px-4 py-2">Actions</th>
          </tr>
        </thead>
        <tbody>
          {trips.map((trip) => (
            <tr key={trip.id}>
              <td className="border px-4 py-2">{trip.id}</td>
              <td className="border px-4 py-2">{trip.package_type}</td>
              <td className="border px-4 py-2">{trip.check_InDate}</td>
              <td className="border px-4 py-2">{trip.check_OutDate}</td>
              <td className="border px-4 py-2">{trip.people_count}</td>
              <td className="border px-4 py-2">{trip.first_name}</td>
              <td className="border px-4 py-2">{trip.last_name}</td>
              <td className="border px-4 py-2">{trip.phone_number}</td>
              <td className="border px-4 py-2">
                <button
                  onClick={() => handleEdit(trip)}
                  className="bg-blue-500 text-white p-2 rounded hover:bg-blue-800 mr-2"
                >
                  Edit
                </button>
                <button
                  onClick={() => handleDelete(trip.id)}
                  className="bg-red-500 text-white p-2 rounded hover:bg-red-800"
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {showEditModal && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex justify-center items-center">
          <div className="bg-white p-8 rounded-md">
            {}
            <h2 className="text-2xl font-bold mb-4">Edit Trip</h2>
            <p>{`Editing trip with ID: ${selectedTrip.id}`}</p>
            {}
            <button onClick={handleEditModalClose} className="bg-gray-500 text-white p-2 rounded hover:bg-gray-700">
              Close
            </button>
          </div>
        </div>
      )}
    </div>
  );
}

export default Manage;
